import PokemonCard from "./PokemonCard";
import axios from "axios";

export default function PokemonList() {
  useEffect(() => {
    const fetchAPI = async () => {
      axios.get("https://pokeapi.co/api/v2/pokemon/ditto").then((response) => {
        console.log(response.data);
      });
      fetchAPI();
    };
  }, []);

  return (
    <div className="row">
      <PokemonCard />
      <PokemonCard />
      <PokemonCard />
      <PokemonCard />
    </div>
  );
}
